import React from "react";
import { Category } from "./Category";

export const Categories = () => {
  const categories = [
    { name: "Pictures" },
    { name: "Documents" },
    { name: "Videos" },
    { name: "Audio" },
  ];
  let categoryComp = "";
  for (let i = 0; i < categories.length; i++) {
    categoryComp += <Category category={categories[i]} />;
  }
  return (
    <div>
      <h1 className="font-bodyFont text-3xl font-extrabold text-sky-950">
        Category
      </h1>
      {/* {categories.map((category) => (
        <Category name={category} key={1} />
      ))} */}
      {categoryComp}
    </div>
  );
};
